import { useNavigate } from "react-router-dom";
import Header from "../../components/Header";
import { handleDetail, handleHome } from "../../routes/cordinator";

function PokemonsDetailPage() {
  const navigate = useNavigate();
  const headerProps = {
    page: "detail", 
    buttonFunction: () => handleDetail(navigate),
    buttonFunctionDelete: ()=>handleHome(navigate),
    textButton: "Todos os Pokémons",
    textButtonDelete: "Excluir do Pokedex",
  }

  return (
    <>
      <h1>Detalhes</h1>
    </>
  );
}
export default PokemonsDetailPage;
